clear;
col_tot = 80;
row_tot = 80;
tic;
%%
%[text] ## Optical conductivty
%[text] Initial Parameters

t = 1;
N_Graphene_site = 4;
epsilon = 0 * ones(1,N_Graphene_site);

Temperature = 1e-4; % 温度
mu = 0; % 化学势
Disorder = 0;

N_Unitcell = col_tot * row_tot;
FB_index = (N_Unitcell+1):(2*N_Unitcell);
BoundaryCond = "PBC";

H0 = full(Graphene_Armchair_Real_Sparse_V2(col_tot, row_tot-1, t, "Boundary",BoundaryCond));
[eigvecs, eigvals] = eig(H0);
eigvals = diag(eigvals);

plot(eigvals,'.','MarkerSize',10); %[output:91034eb4]
hold on %[output:91034eb4]
plot(1:length(eigvals), mu * ones(1, length(eigvals)),'LineWidth',2) %[output:91034eb4]
axis square %[output:91034eb4]
ax = gca;
ax.LineWidth = 1; %[output:91034eb4]
ylabel('E') %[output:91034eb4]
xlabel('N') %[output:91034eb4]
title('Eigenvalue') %[output:91034eb4]
legend({'Eigvals','Fermi level'},'Location','northwest') %[output:91034eb4]

eta = 1e-2;
%%
% Calculate the conductivity
tic;
omega = linspace(0,5 * t,101);
% H0 = H0 + Dis_config;
sigma_PBC = Optical_conductivity_ED(full(H0), repelem(1:col_tot,N_Graphene_site*row_tot), omega, mu, eta, Temperature);
toc; %[output:6f7e101a]
%%

figure %[output:333867c4]
plot(omega, real(sigma_PBC./(omega+1i *1e-5)),'LineWidth',2) %[output:333867c4]
xlabel('$\omega$','Interpreter','latex') %[output:333867c4]
ylabel('$\sigma(\omega)$','Interpreter','latex') %[output:333867c4]
ax = gca;
ax.LineWidth = 1; %[output:333867c4]
axis square %[output:333867c4]
disp(['Integral Result: ',num2str(trapz(omega, sigma_PBC))]) %[output:9c3df7aa]
disp(['total occupied number:', num2str(nnz(eigvals<mu))]) %[output:03cb4660]
legend({"PBC"}) %[output:333867c4]




